import styled from "styled-components";

export const Title = styled.h1`
    color: aliceblue;
    text-align: center;
`;

export const textoCenter = styled.p`
    color: aliceblue;
    text-align: center;
`;

export const Div = styled.div`
  display: flex;
  justify-content: center;

  & p {
    color: aliceblue;
  }
 `;
